const App = () => {
  const x =1;
  let y = 2;

  console.log(x,y);
  y +=12;
  console.log(x,y);
  y = 'test';
  console.log(x,y);

  const t = [1, -1, 3];
  t.push(5);
  console.log(t.length);
  console.log(t);

  t.forEach(value =>{console.log(value)})

}




export default App;
